export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},fpDaTtRikE:{data:{id:265,attributes:{imdbId:"tt0120603",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYTZlMDFkYjItMjgxYi00MDNhLTg0NDYtNDY1NzJkNDg0MGQ4XkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.0\u002F10"},{Source:"Rotten Tomatoes",Value:"78%"},{Source:"Metacritic",Value:"57\u002F100"}],item_lang:{data:{id:928,attributes:{title:b,plot:"Haunted by so many painful and well-hidden secrets, former slave Sethe is bent on finding freedom for the sake of her children. Out of the blue, as Sethe struggles to grapple with her troubled past in her humble home somewhere in post-Civil-War Cincinnati, Paul D, an old familiar from the Kentucky farm euphemistically called Sweet Home, re-enters Sethe's life, eager to lend her a hand. Then a stranger arrives in the shape of a mysterious young woman, giving rise to a series of repressed memories. But who is she? Can Paul D help Sethe reinvent herself?",slug:"beloved"}}},books:{data:[{id:2844,attributes:{title:b,description:"Stunningly-designed new editions of Toni Morrison's best-known novels, published by Vintage Classics in celebration of her life and work. WITH A NEW INTRODUCTION BY BOOKER PRIZE WINNING AUTHOR BERNARDINE EVARISTO Sethe is now miles away from Sweet Home - the farm where she was kept as a slave for many years. Unable to forget the unspeakable horrors that took place there, Sethe is haunted by the violent spectre of her dead child, the daughter who died nameless and whose tombstone is etched with a single word, 'Beloved'. A tale of brutality, horror and, above all, love at any cost, Beloved is Toni Morrison's enduring masterpiece and best-known work.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=tsBhBAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:true,published:"2014-09-04",publisher:"Random House",subtitle:a}},{id:2845,attributes:{title:b,description:"Sethe, an escaped slave living in post-Civil War Ohio with her daughter and mother-in-law, is haunted persistently by the ghost of the dead baby girl whom she sacrificed, in a new edition of the Nobel Laureate's Pulitzer Prize-winning novel. Reader's Guide available. Reprint. 60,000 first printing.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Ann5ugJilcMC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Chloe Anthony Wofford Morrison",d],firstBook:e,published:"2004-01-01",publisher:"Vintage Books",subtitle:"A Novel"}},{id:2846,attributes:{title:b,description:"A stunning gift package of prize-winning Beloved to commemorate Toni Morrison. WITH AN INTRODUCTION BY ZADIE SMITH AND SPECIAL ARCHIVAL MATERIAL It is the mid-1800s and as slavery looks to be coming to an end, Sethe is haunted by the violent trauma it wrought on her former enslaved life at Sweet Home, Kentucky. Her dead baby daughter, whose tombstone bears the single word, Beloved, returns as a spectre to punish her mother, but also to elicit her love. Told with heart-stopping clarity, melding horror and beauty, Beloved is Toni Morrison's enduring masterpiece. 'Toni Morrison was a giant of her times and ours ... Beloved is a heartbreaking testimony to the ongoing ravages of slavery, and should be read by all' Margaret Atwood, New York Times 'An American masterpiece' A.S. Byatt 'No other writer in my lifetime, or perhaps ever, has married so completely an understanding of the structures of power with knowledge of the human heart' Kamila Shamsie 'I adored her honesty. I admired the way she occupied her space in the world. I believed her' Chimamanda Ngozi Adichie **One of the BBC's 100 Novels That Shaped Our World**",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=w-GmyAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:e,published:"2019-12-03",publisher:"Arrow",subtitle:a}},{id:2847,attributes:{title:b,description:"Sethe, an escaped slave living in post-Civil War Ohio with her daughter and mother-in-law, is persistantly haunted by the ghost of her dead baby girl.",thumbnail:a,authors:[d],firstBook:e,published:"1991-01-01",publisher:"New Amer Library",subtitle:a}},{id:2848,attributes:{title:"BELOVED",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zDx7PPIkffIC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["TONI MORRISON"],firstBook:e,published:"1000-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1682568370448}}("","Beloved","movie","Toni Morrison",null,"series",1))